...
From @1lexdarapper: A year ago from today I finished editing the video for our school song “Golden Tickets (MAP Test),” and it literally changed my life. I believe being able to write and produce this original song, THEN making the video with the students and staff was one of the key things that led to so much that happened after. Thanks to Maura, Katie, and Emily for helping get all the shots. And all the staff that danced their butts off. And of course, all seven of the Scholars that rapped their verses flawlessly and helped turn our elementary school into our own studio. Also, thanks to @schoolsofhope and @servewisconsin for always encouraging me to keep being myself...', 'post_hashtags': ['', '#4BarFriday'], 'likes': 29771, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/94907599_682271922520753_1006047470885726979_n.jpg?stp=dst-jpg_e35_s1080x1080&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=101&_nc_ohc=-iCaGzm1bS0AX8TfdA9&edm=APU89FABAAAA&ccb=7-4&oh=00_AT9V8DIe36ROcU47ozwHBrBVPPrHlFUbXXWm0DaXIZj_CA&oe=626B9DC5&_nc_sid=86f79a': {'post_date': '2020-05-02T16:44:36.000Z', 'post_bio': 'My cousin and my chef... sit and talk to you everyday bro and now you’re gone. We speak highly of the Dead but @chef_b_pdx was really the most solid and most genuine 🤦🏾‍♂️. I love you and ima miss you cuzzo 🙏🏽🙏🏽 Rest In Peace', 'post_hashtags': [''], 'likes': 174816, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/95223263_233715177863494_2056093717683717296_n.jpg?stp=dst-jpg_e35_s1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=110&_nc_ohc=1huETPE5FDwAX888W-p&tn=Cv05AHLm7KVTpAnL&edm=APU89FABAAAA&ccb=7-4&oh=00_AT92ZBPms8f_uOykmyPHuIOrKoBYt56uWmoy9yLwVjw3mw&oe=626A4CB9&_nc_sid=86f79a': {'post_date': '2020-05-03T03:37:46.000Z', 'post_bio': 'Damn cuzzo... You been a great cousin and friend to me. 🙏🏽😢', 'post_hashtags': [''], 'likes': 208173, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/9544